import React from 'react';

// COMPONENTS
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons';
import MusicParallax from './MusicParallax';

// IMAGES
import City1 from '../Images/City1.JPG'
import City2 from '../Images/City2.jpg'
import City3 from '../Images/City3.jpg'

// CSS
import '../css/Interests.css'

export default class Interests extends React.Component {

    state = {
        page: ''
    }

    render() {
        return (

            <div className = 'Body'>

                {/* <h1>Interests</h1> */}

                {/* <ul>
                    <li>Sci-fi</li>
                    <li>Garageband / music making</li>
                    <li>Photography</li>
                    <li>Reading</li>
                </ul> */}

                <div className = 'Selection'>
                    <h4 onClick={() => this.Parallax.scrollTo(0)}>Photography</h4>
                    <h4 onClick={() => this.Parallax.scrollTo(2)}>Music</h4>
                </div>

                <Parallax 
                    className = 'Parallax' 
                    ref={ ref => ( this.Parallax = ref ) } 
                    pages={2} 
                    horizontal = {true}
                    style = {{ 'height': '90vh' , 'width': '100%' }}>

                    <div className = 'InterestsParallax'>

                        {/* PHOTOGRAPHY PARALLAX */}

                       <PhotographyParallax/>

                        <MusicParallax/>

                    </div>

                </Parallax>

            </div>

        )
    }

}
